import React from 'react';

class Search extends React.Component{

    rendor(){
        return(
            <div>
                <hr>Search for the Project ID</hr>
                <table>
                    <tr>
                        <th><label>Project ID</label></th>
                        <th><input type="text" id="Project ID"/></th>
                    </tr>
                </table>
            </div>
        );
    }
}

export default Search;
